import './ListItem.css';
const ListItem = ({movie, request}) => {
    const poster = "https://image.tmdb.org/t/p/original" + movie.poster_path;
    console.log(poster);
    return (
        <div class="card">
            <img src={poster} id="moviePoster"></img>
            <div class="card-text">
                <h2>{movie.title}</h2>
                <h3>Popularity: {movie.popularity}</h3>
                <h4>{movie.release_date}</h4>
            </div>
            <p>{movie.overview}</p>
        </div>
    )
}
export default ListItem
